description:
Verenigde Staten
Komedie
98 minuten

geregisseerd door Nigel Cole
met Christopher Walken, Alessandro Nivola en Sharon Stone

Nat (Christopher Walken) is een losbandige oplichter, die beweert alles cadeau te krijgen. De relatie met zijn zoon Flynn is echter al jaren verbroken. Flynn krijgt op een dag, een dag waarop alles al mis leek te gaan, de boodschap van zijn vriendin Maggie (Amanda Peet), dat zijn vader stervende is en hem graag wil zien. Flynn besluit op dit verzoek in te gaan, in een laatste poging de relatie met zijn vader te kunnen herstellen.

